import React from "react";
import ReactDOM from "react-dom";
import AnimatedBg from "react-animated-bg";

import '../App.css';

function AnimatedDogPage() {
  const imagesList = [
    'url("https://images.dog.ceo/breeds/labrador/n02099712_3503.jpg")',
    'url("https://images.dog.ceo/breeds/labrador/n02099712_5844.jpg")',
    'url("https://images.dog.ceo/breeds/labrador/n02099712_7481.jpg")',
    'url("https://images.dog.ceo/breeds/labrador/n02099712_7414.jpg")'
  ];

  return (
    <div>
      <AnimatedBg
        colors={imagesList}
        duration={2}
        delay={1}
        timingFunction="ease-out"
        className="animated-section animated-images"
        
      >
        <div className="App">
          
    
        </div>
      </AnimatedBg>
      <div className = "textd">
      <h3>Before adopting</h3>
      
      </div>
      <h1>Be at least 18 years of age
Understand that adopting can be a 15 to 20 year commitment
Be prepared for ongoing expenses and veterinary care
Agree that if for any reason the adoption does not work out then the animal will be returned to Animals Lebanon
Make an adoption donation of 100,000 LBP</h1>
    </div>
  );
}

export default AnimatedDogPage;
